import React from 'react'

const StarRating = ({stars, size}) => {
    const styles = {
        width: size + 'px',
        height: size + 'px',
        marginRight: size / 6 + 'px',
    };
  return <div>StarRating</div>
  
}

StarRating.defaultProps = {
    size: 18,
};

export default StarRating
